‘ENCHANTED’ world still exists because the child in us never dies!
Like every other girl I’ve been obsessed with butterflies,fairies,flowers and everything magical since childhood and so I decided to create a look on my personal favourite theme.
Ive been soo much in love with this concept that I had planned my twin daughters 1st birthday around this theme too! .
.
I have never played with soo many colours on my face but really wanted to test my versatility and so I used vibrant metallic colours on my eyes and sharp contouring techniques as per the demand of the look!
.
.
Putting up this look together was not as easy as the thought of it.I was the only person who knew what I wanted from this look so I decided to make the floral head gear all by myself by picking all the pretty flowers with vibrant colours to achieve this look.The sparkly butterflies gave the finishing touch to complete this enchanted look.

So get ready to be captivated  under the spell of this magical makeover and let me know in the comments below if I got you Spellbound with this “Enchanted Makeover”

