Always been in awe of @deepikapadukone ‘s beauty and thought of re-creating her look from one of my favourite iconic movie ‘Bajirao Mastani’
@deepikapadukone’s makeup and outfits were a visual treat! 
Her look in the movie was all about elegance.It’s the simplicity that made her look elegantly royal.
This look is all about less is more.
Kept it subtle with flushed cheeks,dewy skin,tinted lips yet making a statement with those strong brows!
The hunt for the perfect outfit for this look landed me in my moms wardrobe since one of her outfits had the closest colour suitable for this look,fitting into it was another story since I lost the count of pins I used to tuck it to make it tight. !
All these absolutely gorgeous accesories that made my look complete the paasa,maang tika and the nose ring are from @zevar.foryouforever 
I personally loved putting up this look together for you guys and would love to know your views on this Mastani look!
Would any of you brides out there wear this look for any of your functions?
Let me know in the comments below 👇

